import maya

maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kLowMemoryWarning'] = u'キャッシュされた再生: キャッシング用のメモリが不足しています。詳細については、スクリプト エディタを参照してください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kMemoryLow'] = u'キャッシュされた再生: キャッシュ専用のメモリが 90% 以下の場合、メモリがもうすぐ不足します。キャッシュを使用し続けるには、再生範囲を小さくするか、[基本設定]の[キャッシュされた再生]セクションでキャッシュにメモリを割り当ててください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kMemoryOut'] = u'キャッシュされた再生: キャッシュ専用のメモリが制限に達したため、キャッシュが停止しました。キャッシュを使用し続けるには、再生範囲を小さくするか、[基本設定]の[キャッシュされた再生]セクションでキャッシュにメモリを割り当ててください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kNoMemoryWarning'] = u'キャッシュされた再生: メモリ不足です。キャッシングに割り当てられたメモリ制限に到達したため、キャッシングは停止しました。詳細については、スクリプト エディタを参照してください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kSafeModeTriggered'] = u'キャッシュされた再生: セーフ モード - サポートされていないノードがシーン内に見つかったため、キャッシュは無効になりました。詳細については、スクリプト エディタを参照してください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kSafeModeUnknown'] = u'セーフ モードがトリガする理由は不明です'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kWarnEMDisabled'] = u'キャッシュされた再生: 評価マネージャが無効になっているため、キャッシュは無効です。詳細については、スクリプト エディタを参照してください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kWarnEMOff'] = u'キャッシュされた再生: 評価モードが DG 評価モードに設定されているため、キャッシュは無効です。詳細については、スクリプト エディタを参照してください。'
maya.stringTable['y_maya_plugin_evaluator_CacheWarningMessages.kWarnEMOffMsg'] = u"キャッシュされた再生: DG 評価モードでは、キャッシュされた再生はサポートされていません。作業を続行できますが、キャッシングは停止しています。キャッシングを再開するには、[アニメーション プリファレンス] ([評価]タブの[プリファレンス] > [設定] > [アニメーション])で評価モードを[並列]または[シリアル]モードに変更します。"
